export default class APIService {
  // Insert an article
  static ShortenUrl(url) {
    return fetch(`/ShortenUrl`, {
      mode: "no-cors",
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      url: JSON.stringify(url),
    })
      .then((response) => response.json())
      .catch((error) => console.log(error));
  }
}
